import React from "react";
const timeTable = (props) => {
  return (
    <table>
      <thead>
        <tr>
          <th> </th>
          <th>8:00 - 9:00</th>
          <th>9:00 - 10:00</th>
          <th>10:15 - 11:15</th>
          <th>11:15 - 12:15</th>
          <th>1:15 - 2:15</th>
          <th>2:15 - 3:15</th>
          <th>3:15 - 4:15</th>
          <th>4:30 - 5:30</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          Monday
          {props.day.map((e) => (
            <td>{e.sub}</td>
          ))}
        </tr>
      </tbody>
    </table>
  );
};

export default timeTable;
